    return (
        <div>
            <img src={logo} width="60" height="100" />
            <h4>{props.studentName}</h4>
            <h5>{props.studentDescription}</h5>
            <h6>Tagi: {props.studentTags}</h6>
            <h5>Wyslij wiadomosc <MdMessage /> </h5>
        </div>
    )
}
